    function parseText(txt) {
        var line = txt.split("\n");
        if (line[0].length >= 19 && line.length == 1) {
            line[0] = txt.slice(0, 19);
            line[1] = txt.slice(19);
        } else if (line.length == 1) {
            line[1] = '';
        }

        return line;
    }

