        parseNum: function (num) {
            num.length == 0 && (num = '0')

            var last = num.slice(-1)
            var arr = []
            if (last == '万' || last == '亿') {
                arr.push(num.slice(0, -1))
                arr.push(num.slice(-1))
            } else {
                arr.push(num)
            }

            return arr
        },

        realNum: function (num) {
            num.length == 0 && (num = '0')

            var last = num.slice(-1)
            var n
            if (last == '万') {
                n = num.slice(0, -1) * 10000
            } else if (last == '亿') {
                n = num.slice(0, -1) * 100000000
            } else {
                n = num
            }

            return n
        },


